import React, { Fragment,useState } from 'react'

export default function Inputmeme() {
    const [meme_author,setMemeauthor] = useState("Abhishek");
    const [meme_caption,setCaption] = useState("Be criative with caption!!");
    const [meme_url,setMemeurl] = useState("https:/......");
    return(
      <Fragment>
          <h1 className="text-center mt-5" >PERN MEME</h1>
          <form className="mt-5">
            <input 
              type="text" 
              className="form-control" 
              value={meme_author} 
              onChange={e => setMemeauthor()}
            />
            <input type="text" className="form-control" value={meme_caption}/>
            <input type="text" className="form-control" value={meme_url}/>
            <button className="btn btn-success">Add</button>
          </form>
      </Fragment>
    );
}
